import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Register.css';

const Register = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [userDetails, setUserDetails] = useState('');
  const [subDetails, setSubDetails] = useState('');
  const [profession, setProfession] = useState('');
  const navigate = useNavigate();

  const handleRegister = async (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      alert('Passwords do not match');
      return;
    }
    console.log('Registering with', email, password, userDetails, subDetails, profession);

    try {
      const response = await fetch('http://localhost:8000/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          email,
          password,
          user_details: userDetails,
          sub_details: subDetails,
          profession,
        }),
      });

      if (response.ok) {
        navigate('/login');
      } else {
        alert('Registration failed');
      }
    } catch (error) {
      console.error('Error during registration:', error);
      alert('An error occurred during registration');
    }
  };

  return (
    <div className={styles.container}>
      <form onSubmit={handleRegister}>
        <h2 className={styles.head}>Register</h2>
        <div>
          <label>Email:</label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
        </div>
        <div>
          <label>Password:</label>
          <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} required />
        </div>
        <div>
          <label>Confirm Password:</label>
          <input type="password" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} required />
        </div>
        <div>
          <label>User Details:</label>
          <textarea value={userDetails} onChange={(e) => setUserDetails(e.target.value)} required></textarea>
        </div>
        <div>
          <label>Sub Details:</label>
          <textarea value={subDetails} onChange={(e) => setSubDetails(e.target.value)} required></textarea>
        </div>
        <div>
          <label>Profession:</label>
          <input type="text" value={profession} onChange={(e) => setProfession(e.target.value)} required />
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default Register;
